import axios from "axios";
import React from "react";

const Picsum_Photos = () => {
  const getApiPhotos = () => {
    axios
      .get("https://picsum.photos/v2/list")
      .then(function (res) {
        const data = res.data;
        return data;
      })
      .catch(function (err) {
        console.log(err);
      });
  };

  return (
    <div>
      <h1 className="text-center text-blue-300">Le pham trung duong</h1>
    </div>
  );
};

export default Picsum_Photos;
